result:
.details{
   /deep/.table-header{
    background-color: #F7F7F7;
    font-weight: normal;
    color: #606266;;
  }

    .list{
      padding:0 32px;
      .title{
        padding-bottom: 24px;
      color: rgba(16, 16, 16, 100);
      font-size: 16px;
      font-weight: bold;
    }
    }
  .info{
    .title{
      padding:0 32px 12px 32px;
      color: rgba(16, 16, 16, 100);
      font-size: 16px;
      font-weight: bold;
    }
    .info-content{
      padding:24px 32px;
      border-top: 1px solid rgba(233, 233, 233, 100);
      display: flex;
      flex-wrap: wrap;
      .line-dashed{
        border-bottom: 1px dashed rgba(233, 233, 233, 100);
        width: 100%;
      }
      .info-text{
        width: 50%;
        margin-bottom: 16px;
        color: rgba(16, 16, 16, 100);
        font-size: 13px;
      }
      .info-text.monopolize{
        width: 100%;
      }
    }

  }
}
